Now this software mockup is almost finished. The major function of this APP is:
1. no need name card, scan barcode from your cellphone then i can add your contact details in my cellphone (that means your contact list is always be updated because once you change info then i can see it in my end);
2. from the cellphone contact i can prepare a meeting, and during the meeting i can use pictures, voice record, text to make sure details are not omitted. A step ahead, you can arrange task during the meeting, even hold a vote;
3. after meeting you send out meeting minute, in the same time, the task arranged during the meeting will be sent to operator.
in the sam time,We offer charts for project follow up, for resources arrangement. 

My skype is carldeng1978

Good afternoon,

Our firm is looking to develop a mobile app for off-site meetings that we host and we're trying to get a ballpark figure before we assign an exact budget to the project.  The focus is to provide a simple way to disseminate valuable information to our visiting members, which will include:

- Speaker bios; 
- Agenda/Itinerary;
- Export reminders to their calendar;
- Presentation PowerPoints;
- Hotel information, such as WiFi access codes, directions to/from airports, and floor plans;
- Our company logo;

The app will need to be recycled for each new meeting, so if there is a way we could simply plug-in new information ourselves for each new meeting instead of re-developing the app or contacting a third party that would be strongly preferred.  

Thank you for your assistance,

Michael Lovett
